//! Tables for the total nonlinear Compton rate,
//! which are integrated over s, k_perp and summed
//! over harmonic index.

pub const LOW_A_LIMIT: f64 = 0.02;
pub const LOW_ETA_LIMIT: f64 = 0.001;

const N_COLS: usize = 55; // number of pts in a0 direction
const N_ROWS: usize = 70; // number of pts in eta direction

pub struct Table2D {
    log_scaled: bool,
    min: [f64; 2],
    step: [f64; 2],
    data: [[f64; N_COLS]; N_ROWS],
}

pub struct Table1D {
    log_scaled: bool,
    min: f64,
    step: f64,
    data: [f64; N_COLS],
}

impl Table2D {
    /// interpolates tabulated function
    #[allow(unused_parens)]
    pub fn at(&self, a: f64, eta: f64) -> Option<f64> {
        let (x, y) = if self.log_scaled {
            (a.ln(), eta.ln())
        } else {
            (a, eta)
        };

        let ix = ((x - self.min[0]) / self.step[0]) as usize;
        let iy = ((y - self.min[1]) / self.step[1]) as usize;

        if ix < N_COLS - 1 && iy < N_ROWS - 1 {
            let dx = (x - self.min[0]) / self.step[0] - (ix as f64);
            let dy = (y - self.min[1]) / self.step[1] - (iy as f64);
            let f = (
                (1.0 - dx) * (1.0 - dy) * self.data[iy][ix]
                + dx * (1.0 - dy) * self.data[iy][ix+1]
                + (1.0 - dx) * dy * self.data[iy+1][ix]
                + dx * dy * self.data[iy+1][ix+1]
            );
            if self.log_scaled {Some(f.exp())} else {Some(f)}
        } else {
            None
        }
    }
}

impl Table1D {
    /// interpolates tabulated function
    #[allow(unused_parens)]
    pub fn at(&self, a: f64) -> Option<f64> {
        let x = if self.log_scaled {
            a.ln()
        } else {
            a
        };

        let ix = ((x - self.min) / self.step) as usize;

        if ix < N_COLS {
            let dx = (x - self.min) / self.step - (ix as f64);
            let f = (
                (1.0 - dx) * self.data[ix]
                + dx * self.data[ix+1]
            );
            if self.log_scaled {Some(f.exp())} else {Some(f)}
        } else {
            None
        }
    }
}

#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn table_lookup_1() {
        let a = 1.0;
        let eta = 0.1;
        let value = RATE_TABLE.at(a, eta).unwrap();
        let expected = 0.0472411;
        let err = ((value - expected) / expected).abs();
        println!("val = {}, expected = {}, err = {:e}", value, expected, err);
    }

    #[test]
    fn table_lookup_0_45() {
        let a = 0.45;
        let eta = 0.055;
        let value = RATE_TABLE.at(a, eta).unwrap();
        let expected = 0.00644313;
        let err = ((value - expected) / expected).abs();
        println!("val = {}, expected = {}, err = {:e}", value, expected, err);
    }

    #[test]
    fn table_lookup_3() {
        let a = 3.0;
        let eta = 0.15;
        let value = RATE_TABLE.at(a, eta).unwrap();
        let expected = 0.33683;
        let err = ((value - expected) / expected).abs();
        println!("val = {}, expected = {}, err = {:e}", value, expected, err);
    }
}

